import React from 'react'
import './contacts.css'
import {
    MDBIcon,
    MDBBtn
  } from 'mdb-react-ui-kit';

const Contacts = () => {
    return (
        <div className="message">
            <p>To book an appointment or if you have any questions, contact the number listed below.</p>
            <p>Thank you!</p>

            <p>Acceptable payments:</p>
          <MDBBtn outline color="dark" floating className='m-1' href='https://www.facebook.com/people/Concord-Nail-Tek/100095126682743/' role='button' target="_blank">
            <MDBIcon fab icon='cc-visa' size='2x' style={{ color: 'black' }} />
          </MDBBtn>

          <MDBBtn outline color="dark" floating className='m-1' href='https://www.instagram.com/moonnails8639/' role='button' target="_blank">
            <MDBIcon fab icon='cc-mastercard' size='2x' style={{color:'black'}}/>
          </MDBBtn>
        </div>
    )
}

export default Contacts;
